svg.script:
(function () {
	var svg = document.documentElement;
	function updateLanguage() {
		var lang = svg.getAttribute('data-lang') || 'en';
		var groups = svg.querySelectorAll('.lang');
		for (var i = 0; i < groups.length; i++) {
			var g = groups[i];
			g.style.display = (g.getAttribute('data-lang') === lang) ? 'inline' : 'none';
		}
	}
	// Observe changes to the root svg attributes (so changing data-lang will update immediately)
	var observer = new MutationObserver(function (mutations) {
		for (var i = 0; i < mutations.length; i++) {
			if (mutations[i].attributeName === 'data-lang') {
				updateLanguage();
			}
		}
	});
	observer.observe(svg, { attributes: true });
	// initialize
	updateLanguage();
})();
